import { StyledGrid } from "../styles";

const Playlist = ({ artists }) => {
  console.log(artists);
  return (
    <>
      {artists && artists.length ? (
        <StyledGrid type="artist">
          {artists.map((artist, i) => (
            <li className="grid__item" key={i}>
              <div className="grid__item__inner">
                {artist.data.tracks.items[0].album.images[0] && (
                  <div className="grid__item__img">
                    <img
                      src={artist.data.tracks.items[0].album.images[0].url}
                      alt={artist.data.tracks.items[0].name}
                    />
                  </div>
                )}
                <h3 className="grid__item__name overflow-ellipsis">
                  {artist.data.tracks.items[0].name}
                </h3>
                <p className="grid__item__label">Artist</p>
              </div>
            </li>
          ))}
        </StyledGrid>
      ) : (
        <p className="empty-notice">No artists available</p>
      )}
    </>
  );
};

export default Playlist;
